import React, { useState } from "react";
import { Link } from "react-router-dom";
import { FaPhoneAlt, FaCommentDots } from "react-icons/fa"; // Import icons
import logo from "../assets/toyota_logo.png"; // Adjust this path

const Navbar = () => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  return (
    <nav className="bg-white shadow-md">
      <div className="container mx-auto px-4 py-2 flex items-center justify-between">
        {/* Toyota Logo */}
        <img src={logo} alt="Toyota Logo" className="h-12" />

        {/* Navigation Links */}
        <ul className="flex items-center space-x-6 text-black font-bold uppercase">
          <li><Link to="/" className="hover:text-red-600 hover:underline">Home</Link></li>
          <li><Link to="/products" className="hover:text-red-600 hover:underline">Products</Link></li>
          <li><Link to="/virtualshowroom" className="hover:text-red-600 hover:underline">Virtual Showroom</Link></li>
          <li><Link to="/service" className="hover:text-red-600 hover:underline">Service</Link></li>
          <li><Link to="/tcare" className="hover:text-red-600 hover:underline">T-Care</Link></li>
          <li><Link to="/usedcars" className="hover:text-red-600 hover:underline">Used Cars</Link></li>
          <li><Link to="/mobility" className="hover:text-red-600 hover:underline">Mobility</Link></li>
          <li><Link to="/buyonline" className="hover:text-red-600 hover:underline">Buy Online</Link></li>
        </ul>

        {/* Call & Message Icons */}
        <div className="flex space-x-4">
          <Link to="/contact" className="text-black hover:text-red-600 text-xl">
            <FaPhoneAlt />
          </Link>
          <Link to="/contact" className="text-black hover:text-red-600 text-xl relative">
            <FaCommentDots />
            <span className="absolute -top-2 left-3 bg-red-600 text-white text-xs px-1 rounded-full">1</span> 
            {/* Optional notification bubble */}
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
